import Navigation from '../components/Navigation';

const Home = () => {
    return (
        <div>
            <Navigation />
            <div className="homeContent">
                <div className="content">
                    <h1>Amadou Dioulde BA</h1>
                    <h2>Informaticien</h2>
                    <div className="pdf">
                        <a href="./media/CV.pdf" target='_blank'>Télécharger CV</a>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Home;
